import React,{Component} from 'react'

type State = typeof initState;
const initState = {
  string: "Hello my friend" as string
}
class Header extends Component<{},State>{

    state = initState

    render(){
        return <div key={1}>
            <a href="#" className="hkl"></a>
        </div>
    }
}

export default Header;
